export const phoneLoaded = (newBooks) => {
  return {
    type: PHONE_LOADED,
    payload: newBooks,
  }
}

export const addPrice = (price) => {
  return {
    type: ADD_PRICE,
    price: price,
  }
}

export const addProduct = (product) => {
  return {
    type: ADD_PRODUCT,
    product: product,
  }
}
export const addLoading = (loading) => {
  return {
    type: CHANGE_LOADING,
    loading,
  }
}
export const addError = (error) => {
  return {
    type: CHANGE_ERROR,
    error,
  }
}
export const minusCart = (id) => {
  return {
    type: MINUS_CART,
    id,
  }
}
export const plusCart = (id) => {
  return {
    type: PLUS_CART,
    id,
  }
}
export const deleteCart = (id) => {
  return {
    type: DELETE_CART,
    id,
  }
}
